    <Card fluid>
    <Image src='https://www.sciencenews.org/wp-content/uploads/2018/02/020118_SM_polar-bear_main.jpg' wrapped ui={false} />
    <Card.Content>
      <Card.Header>Matthew</Card.Header>
      <Card.Meta>
        <span className='date'>Joined in 2015</span>
      </Card.Meta>
